exports.handler = async (event) => {
  const response = {
    statusCode: 200,
    headers: {
      'Content-Type': 'application/json',
      'Access-Control-Allow-Origin': '*',
    },
    body: JSON.stringify({
      status: 'healthy',
      timestamp: new Date().toISOString(),
      version: '1.0.0',
      phase: '1.1-Infrastructure-Foundation',
      environment: process.env.ENVIRONMENT || 'development',
    }),
  };
  return response;
};
